import "./reserveTutorscr.css"

import { useState } from 'react';

const tutors = [
  { id: 1, name: 'Martin Smith' },
  { id: 2, name: 'Test9 3' },
  { id: 3, name: 'wass Doe' },
  { id: 4, name: 'Test229 3' },
  { id: 5, name: 'Layla Arwa' },
  { id: 6, name: 'test222 Doe' },
  { id: 7, name: 'Test9 3' },
  { id: 8, name: 'Test2129 3' },
  { id: 9, name: 'Test29 3' },
  { id: 10, name: '1wass Doe' },
  { id: 11, name: 'test222 Doe' },
  { id: 12, name: 'test222 Doe' },
  { id: 13, name: 'Test5 3' },
  { id: 14, name: 'Test9 3' },
  { id: 15, name: 'Test29 3' },
  { id: 16, name: 'Test5 3' },
  { id: 17, name: 'Test29 3' },
  { id: 18, name: 'Test9 3' },
  { id: 19, name: 'Test929 3' },
  { id: 20, name: 'Test229 3' },
  { id: 21, name: '2wass Doe' },
  { id: 22, name: 'Test 3' },
  { id: 23, name: 'Test5 3' },
  { id: 24, name: 'Test9 3' },
  { id: 25, name: 'John Doe' },
  { id: 26, name: 'Test29 3' },
  { id: 27, name: 'Test2129 3' },
  { id: 28, name: 'test222 Doe' },
  { id: 29, name: 'Test 3' },
  { id: 30, name: 'Test19 3' },
  { id: 31, name: 'Test29 3' },
  { id: 32, name: 'Test5 3' },
  { id: 33, name: 'Test29 3' },
  { id: 34, name: 'Test 2' },
  { id: 35, name: 'John White' },
  { id: 36, name: 'Test29 3' },
  { id: 37, name: 'Test929 3' },

];

const subjects = [
  { id: 1, name: 'Integral Calculus' },
  { id: 2, name: 'Linear Algebra' }
];

const apiUrl = 'https://x4g0ddpp1f.execute-api.us-east-2.amazonaws.com/prod/Create/reservations';

function ReserveTutorPage() {
  const [tutorId, setTutorId] = useState(null);
  const [date, setDate] = useState('');
  const [time, setTime] = useState('');
  const [duration, setDuration] = useState('');
  const [subjectId, setSubjectId] = useState(null);

  function handleSubmit(event) {
    // ...
  }

  // Filter tutors based on availability
  const availableTutors = tutors.filter(tutor => {
    const availability = tutor.available.find(item => item.date === date);
    if (availability) {
      return availability.times.includes(time);
    }
    return false;
  });

  return (
    <form onSubmit={handleSubmit}>
      <h1>Reserve a tutor now:</h1>
      <label>
        Tutor:
        <select value={tutorId} onChange={event => setTutorId(parseInt(event.target.value))}>
          <option value="">-- Choose a tutor --</option>
          {availableTutors.map(tutor => (
            <option key={tutor.id} value={tutor.id}>
              {tutor.name}
            </option>
          ))}
        </select>
      </label>
      <br />
      <label>
        Subject:
        <select value={subjectId} onChange={event => setSubjectId(parseInt(event.target.value))}>
          <option value="">-- Choose a subject --</option>
          {subjects.map(subject => (
            <option key={subject.id} value={subject.id}>
              {subject.name}
            </option>
          ))}
        </select>
      </label>
      <br />
      <label>
        Date:
        <input type="date" value={date} onChange={event => setDate(event.target.value)} min="1000-01-01" max="9999-12-31" />
      </label>
      <br />
      <label>
        Time:
        <input type="time" value={time} onChange={event => setTime(event.target.value)} />
      </label>
      <br />
      <label>
        Duration:
        <input type="number" value={duration} onChange={event => setDuration(parseInt(event.target.value))} />
      </label>
      <br />
      <button type="submit">Reserve</button>
    </form>
  );
}
export default ReserveTutorPage;
